export const cropCategoryMap = {
  Tomato: "Vegetables",
  "Green Chilli": "Vegetables",
  Onion: "Vegetables",
  Potato: "Vegetables",

  Banana: "Fruits",
  Apple: "Fruits",
  Mango: "Fruits",

  Cotton: "Others",
  Paddy: "Others",
  Wheat: "Others",
  Rice: "Others"
};

export const getCategory = (commodity) => {
  return cropCategoryMap[commodity] || "Others";
};
